CREATE TABLE `bz_postmeta` (
  `meta_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `post_id` bigint(20) unsigned NOT NULL DEFAULT '0',
  `meta_key` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `meta_value` longtext COLLATE utf8mb4_unicode_ci,
  PRIMARY KEY (`meta_id`),
  KEY `post_id` (`post_id`),
  KEY `meta_key` (`meta_key`(191))
) ENGINE=InnoDB AUTO_INCREMENT=2521 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;






CREATE TABLE `bz_posts` (
  `ID` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `post_author` bigint(20) unsigned NOT NULL DEFAULT '0',
  `post_date` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `post_date_gmt` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `post_content` longtext COLLATE utf8mb4_unicode_ci NOT NULL,
  `post_title` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `post_excerpt` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `post_status` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'publish',
  `comment_status` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'open',
  `ping_status` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'open',
  `post_password` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `post_name` varchar(200) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `to_ping` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `pinged` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `post_modified` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `post_modified_gmt` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `post_content_filtered` longtext COLLATE utf8mb4_unicode_ci NOT NULL,
  `post_parent` bigint(20) unsigned NOT NULL DEFAULT '0',
  `guid` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `menu_order` int(11) NOT NULL DEFAULT '0',
  `post_type` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'post',
  `post_mime_type` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `comment_count` bigint(20) NOT NULL DEFAULT '0',
  PRIMARY KEY (`ID`),
  KEY `post_name` (`post_name`(191)),
  KEY `type_status_date` (`post_type`,`post_status`,`post_date`,`ID`),
  KEY `post_parent` (`post_parent`),
  KEY `post_author` (`post_author`)
) ENGINE=InnoDB AUTO_INCREMENT=967 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


\n<p>Với phụ nữ việc sở hữu một làn da trắng dáng và mềm mịn là điều cần thiết . Vì vậy, họ không ngần ngại chi một khoản tiền lớn để mua các loại mỹ phẩm chăm sóc da .Nhưng có rất nhiều người đã gặp phải tình trạng tiền mất tật mang khi không sử dụng mỹ phẩm đúng cách.Bài viết dưới đây của <strong>mỹ phẩm tắm trắng toàn thân Vy Barbie</strong> sẽ chỉ ra các sai lầm cũng như hướng dẫn các chị em cách sử dụng mỹ phẩm như thế nào là đúng cách</p>\n<p>Mỹ phẩm có thể được xem là một con dao hai lưỡi ,bởi có thể chỉ cần một sai sót nhỏ hoặc sử dụng mỹ phẩm khác nhau cũng có thể khiến bạn gặp hoạ. Bởi mỗi mỹ phẩm được chiết xuất theo một cách riêng và nếu đủ am hiểu mới có thể kết hợp các loại mỹ phẩm với nhau.</p>\n<h2><strong>Những sai lầm cơ bản khi chọn mỹ phẩm</strong></h2>\n<h3><strong>1. Sai lầm khi không chọn mỹ phẩm phù hợp với từng loại da</strong></h3>\n<p>Có rất nhiều phụ nữ cho rằng chỉ cần mua các các loại mỹ phẩm đắt tiền từ các thương hiệu nổi tiếng thì có thể có một làn da đẹp và mịn màng.Đây chính là sai lầm khiến làn da của bạn sẽ bị tồn hại , nổi mụn hoặc các tác dụng phụ khác.Bởi mỗi người sẽ có một làn da khác nhau,nếu không chọn những loại mỹ phẩm không phù hợp dù có đắt tiền cũng không thể cải thiện da mà còn ngược lại gây hại cho da.</p>\n<p>Theo như nghiên cứu của các chuyên gia , hầu hết phụ nữ Việt sở hữu một làn da hỗn hợp.Đây là một làn da phức tạp khi vùng mũi ,trán rất nhờn còn hai bên má và lại rất khô. Làn da này dễ bị các tác hại của bên ngoài như khó bụi ,ô nhiễm môi trường khiến da tổn hại .Và gây nên mụn , nám làm bạn mất tự tin trước mọi người .</p>\n<p>Với phụ nữ việc sở hữu một làn da trắng dáng và mềm mịn là điều cần thiết . Vì vậy, họ không ngần ngại chi một khoản tiền lớn để mua các loại mỹ phẩm chăm sóc da .Nhưng có rất nhiều người đã gặp phải tình trạng tiền mất tật mang khi không sử dụng mỹ phẩm đúng cách.Bài viết dưới đây của <strong>mỹ phẩm tắm trắng toàn thân Vy Barbie</strong> sẽ chỉ ra các sai lầm cũng như hướng dẫn các chị em cách sử dụng mỹ phẩm như thế nào là đúng cách</p>\n<p><img src=\"http://myphamvybarbie.com/uploads/images/su-dung-my-pham-02.jpg\" alt=\"Sử dụng mỹ phẩm như thế nào là đúng cách ?\" /></p>\n<p><em><strong>Sử dụng mỹ phẩm như thế nào là đúng cách ?</strong></em></p>\n<p>Mỹ phẩm có thể được xem là một con dao hai lưỡi ,bởi có thể chỉ cần một sai sót nhỏ hoặc sử dụng mỹ phẩm khác nhau cũng có thể khiến bạn gặp hoạ. Bởi mỗi mỹ phẩm được chiết xuất theo một cách riêng và nếu đủ am hiểu mới có thể kết hợp các loại mỹ phẩm với nhau.</p>\n<h2><strong>Những sai lầm cơ bản khi chọn mỹ phẩm</strong></h2>\n<h3><strong>1. Sai lầm khi không chọn mỹ phẩm phù hợp với từng loại da</strong></h3>\n<p>Có rất nhiều phụ nữ cho rằng chỉ cần mua các các loại mỹ phẩm đắt tiền từ các thương hiệu nổi tiếng thì có thể có một làn da đẹp và mịn màng.Đây chính là sai lầm khiến làn da của bạn sẽ bị tồn hại , nổi mụn hoặc các tác dụng phụ khác.Bởi mỗi người sẽ có một làn da khác nhau,nếu không chọn những loại mỹ phẩm không phù hợp dù có đắt tiền cũng không thể cải thiện da mà còn ngược lại gây hại cho da.</p>\n<p>Theo như nghiên cứu của các chuyên gia , hầu hết phụ nữ Việt sở hữu một làn da hỗn hợp.Đây là một làn da phức tạp khi vùng mũi ,trán rất nhờn còn hai bên má và lại rất khô. Làn da này dễ bị các tác hại của bên ngoài như khó bụi ,ô nhiễm môi trường khiến da tổn hại .Và gây nên mụn , nám làm bạn mất tự tin trước mọi người .</p>\n<p><img src=\"http://myphamvybarbie.com/uploads/images/su-dung-my-pham-03.jpg\" alt=\"Sử dụng mỹ phẩm như thế nào là đúng cách ?\" /></p>\n<p><em><strong>Sử dụng mỹ phẩm như thế nào là đúng cách ?</strong></em></p>\n<h3><strong>2. Không tìm hiểu về nguồn gốc xuất xứ của các loại mỹ phẩm</strong></h3>\n<p>Sai lầm thứ hai là sử dụng mỹ phẩm không rõ nguồn gốc xuất xứ. Đây chính là sai lầm mà hầu hết đại đa số các chị em phụ nữ đều mắc phải. Bởi họ không hề tìm hiểu kĩ trước khi sử dụng mà chỉ tin lời của những quảng cáo trên facebook hoặc một người nào đó giới thiệu .Đã có rất nhiều người sau một thời da ngắn , chẳng những không đẹp lên như mong muốn mà còn tá hoả khi khuôn mặt bị bị bỏng rát, sưng phù, nổi mụn chi chít mất rất nhiều tiền bạc và thời gian để vào bệnh viện điều trị</p>\n<p>Đa số chị em khi sử dụng mỹ phẩm đều không chú ý đến các bảo quản và sai lầm thứ ba chính là đây.Bởi mỹ phẩm được bảo quản trong thời gian 3 năm kể từ ngày sản xuất và với điều kiện môi trường mát mẻ và chưa mở nắp. Nếu đã mở nắp sản phẩm thì chất bảo quản sẽ bị phân huỷ và ảnh hưởng đến chất lượng của sản phẩm.</p>\n<p><strong><em>Tham Khảo Bài Viết: <u>Kinh Nghiệm Cần Biết Khi Mua Mỹ Phẩm</u></em></strong></p>\n<h3>3.Không chú ý thời gian sản xuất và hạn sử dụng</h3>\n<p>Hạn sử dụng mỹ phẩm chính là sai lầm thứ tư của phụ nữ khi sử dụng mỹ phẩm. Rất nhiều người thường mua sản phẩm như không hề chú ý đến thời gian sản xuất cũng như hạn sử dụng .Nếu mỹ phẩm hết hạn sử dụng mỹ phẩm có thể xảy ra các tác dụng phụ và gây ảnh hưởng cho da</p>\n<!-- /wp:paragraph -->","Hướng dẫn sử dụng mỹ phẩm đúng cách","","publish","open","open","","chao-moi-nguoi","","","2019-02-27 16:19:28","2019-02-27 16:19:28","","0","https://tppone.com/demo/shop3/?p=1","0","post","","1"),
("2","1","2019-02-27 03:07:38","2019-02-27 03:07:38","<!-- wp:paragraph -->\n<p>Đây là trang mẫu. Nó khác với bài viết bởi vì nó thường cố định và hiển thị trong menu của bạn. Nhiều người bắt đầu với trang Giới thiệu nơi bạn chia sẻ thông tin cho những ai ghé thăm. Nó có thể bắt đầu như thế này:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Chào bạn! Tôi là một người bán hàng, và đây là website của tôi. Tôi sống ở Hà Nội, có một gia đình nhỏ, và tôi thấy cách sử dụng WordPress rất thú vị.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>... hoặc cái gì đó như thế này:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Công ty chúng tôi được thành lập năm 2010, và cung cấp dịch vụ chất lượng cho rất nhiều sự kiện tại khắp Việt Nam. Với văn phòng đặt tại Hà Nội, TP. Hồ Chí Minh cùng hơn 40 nhân sự, chúng tôi là nơi nhiều đối tác tin tưởng giao cho tổ chức các sự kiện lớn.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>Là một người dùng WordPress mới, bạn nên ghé thăm <a href=\"https://bizhostvn.com/w/shop3/wp-admin/\">bảng tin</a> để xóa trang này và tạo trang mới cho nội dung của chính bạn. Chúc bạn vui vẻ!</p>\n<!-- /wp:paragraph -->","Trang Mẫu","","publish","closed","open","","Trang mẫu","","","2019-02-27 03:07:38","2019-02-27 03:07:38","","0","https://tppone.com/demo/shop3/?page_id=2","0","page","","0"),
("3","1","2019-02-27 03:07:38","2019-02-27 03:07:38","<!-- wp:heading --><h2>Chúng tôi là ai</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Địa chỉ website là: https://bizhostvn.com/w/shop3.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Thông tin cá nhân nào bị thu thập và tại sao thu thập</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Bình luận</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Khi khách truy cập để lại bình luận trên trang web, chúng tôi thu thập dữ liệu được hiển thị trong biểu mẫu bình luận và cũng là địa chỉ IP của người truy cập và chuỗi user agent của người dùng trình duyệt để giúp phát hiện spam</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Một chuỗi ẩn danh được tạo từ địa chỉ email của bạn (còn được gọi là hash) có thể được cung cấp cho dịch vụ Gravatar để xem bạn có đang sử dụng nó hay không. Chính sách bảo mật của dịch vụ Gravatar có tại đây: https://automattic.com/privacy/. Sau khi chấp nhận bình luận của bạn, ảnh tiểu sử của bạn được hiển thị công khai trong ngữ cảnh bình luận của bạn.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Thư viện</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Nếu bạn tải hình ảnh lên trang web, bạn nên tránh tải lên hình ảnh có dữ liệu vị trí được nhúng (EXIF GPS) đi kèm. Khách truy cập vào trang web có thể tải xuống và giải nén bất kỳ dữ liệu vị trí nào từ hình ảnh trên trang web.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Thông tin liên hệ</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cookies</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Nếu bạn viết bình luận trong website, bạn có thể cung cấp cần nhập tên, email địa chỉ website trong cookie. Các thông tin này nhằm giúp bạn không cần nhập thông tin nhiều lần khi viết bình luận khác. Cookie này sẽ được lưu giữ trong một năm.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Nếu bạn có tài khoản và đăng nhập và website, chúng tôi sẽ thiết lập một cookie tạm thời để xác định nếu trình duyệt cho phép sử dụng cookie. Cookie này không bao gồm thông tin cá nhân và sẽ được gỡ bỏ khi bạn đóng trình duyệt.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Khi bạn đăng nhập, chúng tôi sẽ thiết lập một vài cookie để lưu thông tin đăng nhập và lựa chọn hiển thị. Thông tin đăng nhập gần nhất lưu trong hai ngày, và lựa chọn hiển thị gần nhất lưu trong một năm. Nếu bạn chọn &quot;Nhớ tôi&quot;, thông tin đăng nhập sẽ được lưu trong hai tuần. Nếu bạn thoát tài khoản, thông tin cookie đăng nhập sẽ bị xoá.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Nếu bạn sửa hoặc công bố bài viết, một bản cookie bổ sung sẽ được lưu trong trình duyệt. Cookie này không chứa thông tin cá nhân và chỉ đơn giản bao gồm ID của bài viết bạn đã sửa. Nó tự động hết hạn sau 1 ngày.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Nội dung nhúng từ website khác</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Các bài viết trên trang web này có thể bao gồm nội dung được nhúng (ví dụ: video, hình ảnh, bài viết, v.v.). Nội dung được nhúng từ các trang web khác hoạt động theo cùng một cách chính xác như khi khách truy cập đã truy cập trang web khác.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Những website này có thể thu thập dữ liệu về bạn, sử dụng cookie, nhúng các trình theo dõi của bên thứ ba và giám sát tương tác của bạn với nội dung được nhúng đó, bao gồm theo dõi tương tác của bạn với nội dung được nhúng nếu bạn có tài khoản và đã đăng nhập vào trang web đó.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Phân tích</h3><!-- /wp:heading --><!-- wp:heading --><h2>Chúng tôi chia sẻ dữ liệu của bạn với ai</h2><!-- /wp:heading --><!-- wp:heading --><h2>Dữ liệu của bạn tồn tại bao lâu</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Nếu bạn để lại bình luận, bình luận và siêu dữ liệu của nó sẽ được giữ lại vô thời hạn. Điều này là để chúng tôi có thể tự động nhận ra và chấp nhận bất kỳ bình luận nào thay vì giữ chúng trong khu vực đợi kiểm duyệt.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Đối với người dùng đăng ký trên trang web của chúng tôi (nếu có), chúng tôi cũng lưu trữ thông tin cá nhân mà họ cung cấp trong hồ sơ người dùng của họ. Tất cả người dùng có thể xem, chỉnh sửa hoặc xóa thông tin cá nhân của họ bất kỳ lúc nào (ngoại trừ họ không thể thay đổi tên người dùng của họ). Quản trị viên trang web cũng có thể xem và chỉnh sửa thông tin đó.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Các quyền nào của bạn với dữ liệu của mình</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Nếu bạn có tài khoản trên trang web này hoặc đã để lại nhận xét, bạn có thể yêu cầu nhận tệp xuất dữ liệu cá nhân mà chúng tôi lưu giữ về bạn, bao gồm mọi dữ liệu bạn đã cung cấp cho chúng tôi. Bạn cũng có thể yêu cầu chúng tôi xóa mọi dữ liệu cá nhân mà chúng tôi lưu giữ về bạn. Điều này không bao gồm bất kỳ dữ liệu nào chúng tôi có nghĩa vụ giữ cho các mục đích hành chính, pháp lý hoặc bảo mật.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Các dữ liệu của bạn được gửi tới đâu</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Các bình luận của khách (không phải là thành viên) có thể được kiểm tra thông qua dịch vụ tự động phát hiện spam.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Thông tin liên hệ của bạn</h2><!-- /wp:heading --><!-- wp:heading --><h2>Thông tin bổ sung</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cách chúng tôi bảo vệ dữ liệu của bạn</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Các quá trình tiết lộ dữ liệu mà chúng tôi thực hiện</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Những bên thứ ba chúng tôi nhận dữ liệu từ đó</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Việc quyết định và/hoặc thu thập thông tin tự động mà chúng tôi áp dụng với dữ liệu người dùng</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Các yêu cầu công bố thông tin được quản lý</h3><!-- /wp:heading -->","Chính sách bảo mật","","draft","closed","open","","chinh-sach-bao-mat